import styles from "./Home.module.css";
import { MantineProvider, Box, Card, TextInput } from "@mantine/core";

function Home() {
  const form =
    useForm <
    {
      username: string,
      paswsowrd: string,
    } >
    {
      initialValues: {
        fase: "",
        porte: "",
        ppd: "",
        prazo: undefined,
        valor: 0,
        editIndex: -1,
        taxaFoiCalculada: false,
      },
    };
  return (
    <MantineProvider>
      <Box>
        <Card shadow={"1rem"} withBorder padding={"1rem"}>
          <TextInput></TextInput>
        </Card>
      </Box>
    </MantineProvider>
  );
}

export default Home;
